    private class DateCell
    {
        public Int32 base_;
        public Int32[] calc;

        public void Initialize()
        {
            if (!initialized)
            {
                Int32 vcalc = base_;
                Int32 Seed = vcalc;

                calc = new Int32[CalcCount];
                for (int n = 0; n < CalcCount; n++)
                {
                    UInt16 input;

                    my_rand(ref Seed);
                    while ((input = (UInt16) my_rand(ref Seed)) >= (BasePeriod * RandRange) / 2);
                    calc[n] = vcalc += (input % RandRange) + MinDelta;
                    my_rand(ref Seed);
                }

                initialized = true;
            }
        }

        private bool initialized = false;
    }

    private static DateCell[] data = new DateCell[BaseCount];

    static IntDate66k()
    {
        Int32 value = LongStart - (BasePeriod * RandRange) / 2;

        for (int i = 0; i < BaseCount; i++)
        {
            data[i] = new DateCell();
            data[i].base_ = value += bases[i] + BasePeriod * MinDelta;
        }
    }
